column8:
１本で４つの効果があり、手間いらず。！<Br>
１、中和（カルキ抜き）<Br>
２、エラや粘膜の保護<Br>
３、水道水の重金属を無害に<Br>
４、白濁りを除去します。<Br><Br>
●水道水に含まれるカルキを中和します。<br>
●コロイド成分が魚のエラと粘膜を換水時のショックから保護します。<br>
●ポリマー成分が白にごりの原因部質を凝集除去。<br>
●水道水に含まれる重金属を無害化します。<br>
<B>●魚を健康に育てるビタミンBを含有。</b><br>
<b>●淡水用</b>

<br><Br>内容量：500ml<br><br>

【使用量の例】キャップ1杯は約30mlです。<Br>
<TABLE BORDER="1">
<TR><TD>水量</TD><TD>使用量</TD></tr>

<TR><TD>水20L</TD><TD>約4ml（キャップ約1/8杯）</td></TR>
<TR><TD>一般的な60cm水槽（約60L)</TD><td>約12ml（キャップ約半分弱）</td></TR>
<TR><TD>一般的な90cm水槽（約150L)</TD><td>約30ml（キャップ約1杯）</td></TR>
</TABLE><Br><br>
