ミネラル入りで魚の新陳代謝、健康維持に。タブレットなので水槽にポイといれるだけ！めんどうなカップなどでの計量が不要です。地中海イタリア・シチリア産の良質の天日海塩を使用しています。<BR><BR>
●水槽を新しくセットした時に！<BR>
●水槽の水換えやお掃除後に！<BR>
●魚を移動させる時に！<BR><BR>
水10Lに対して１タブレットの割合で使用します。<BR><BR>
【使用量の目安】<Br>
S 水槽（約12リットル） 1タブレット<Br>
M 水槽（約18リットル） 1～2タブレット<Br>
L水槽（約23リットル） 2タブレット<Br>
45cm 水槽（約35リットル） 3タブレット<Br>
60cm 水槽（約55リットル） 5タブレット<Br><Br>
【成分】<BR>
ナトリウム、カルシウム、カリウム、マグネシウム、天然ミネラル類<BR><BR>
メーカー：水作<BR><BR>
※使用上のご注意<BR>
○魚の病気を治療する魚病薬ではありません。<BR>
○種類によっては塩分を嫌う魚もいます。使用前によく確認して下さい。<BR>
○水草水槽での使用には適しません。<BR>
○高温多湿な場所は避けて保管して下さい。<br><br>
キーワード：金魚の病気予防　白点虫<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

